/*Table structure for table `purchase_details` */

DROP TABLE IF EXISTS `purchase_details`;

CREATE TABLE `purchase_details` (
  `purchase_details_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `purchase_id` bigint(20) NOT NULL,
  `hsn_code` varchar(50) DEFAULT NULL,
  `item_name` varchar(200) DEFAULT NULL,
  `unit_price` double DEFAULT NULL,
  `gst_percentage` double DEFAULT NULL,
  `gst_amount` double DEFAULT NULL,
  `quantity` double DEFAULT NULL,
  `gross_amount` double DEFAULT NULL,
  `discount` double DEFAULT NULL,
  `net_amount` double DEFAULT NULL,
  `item_id` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`purchase_details_id`),
  KEY `fk_purchase` (`purchase_id`),
  CONSTRAINT `fk_purchase` FOREIGN KEY (`purchase_id`) REFERENCES `purchase` (`purchase_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=163 DEFAULT CHARSET=utf8;

