/*Table structure for table `sales_details` */

DROP TABLE IF EXISTS `sales_details`;

CREATE TABLE `sales_details` (
  `sales_details_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `sales_id` bigint(20) NOT NULL,
  `hsn_code` varchar(50) DEFAULT NULL,
  `item_name` varchar(200) DEFAULT NULL,
  `unit_price` double DEFAULT NULL,
  `gst_percentage` double DEFAULT NULL,
  `gst_amount` double DEFAULT NULL,
  `quantity` double DEFAULT NULL,
  `gross_amount` double DEFAULT NULL,
  `discount` double DEFAULT NULL,
  `net_amount` double DEFAULT NULL,
  `item_id` bigint(20) DEFAULT NULL,
  `mrp` double DEFAULT NULL,
  PRIMARY KEY (`sales_details_id`),
  KEY `sales detail to item relation` (`hsn_code`),
  KEY `fk_sales` (`sales_id`),
  CONSTRAINT `fk_sales` FOREIGN KEY (`sales_id`) REFERENCES `sales` (`sales_id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=14087 DEFAULT CHARSET=utf8;

