/*Table structure for table `stock_backup` */

DROP TABLE IF EXISTS `stock_backup`;

CREATE TABLE `stock_backup` (
  `item_id` bigint(20) NOT NULL DEFAULT '0',
  `hsn_code` varchar(50) NOT NULL,
  `item_name` varchar(200) NOT NULL,
  `category` varchar(50) DEFAULT NULL,
  `supplier` varchar(50) DEFAULT NULL,
  `description` varchar(200) DEFAULT NULL,
  `purchase_price` double DEFAULT NULL,
  `gst_percentage` double DEFAULT NULL,
  `gst_amount` double DEFAULT NULL,
  `margin` double DEFAULT NULL,
  `discount` double DEFAULT NULL,
  `selling_price` double DEFAULT NULL,
  `quantity` double DEFAULT NULL,
  `reorder_quantity` double DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `stock_backup` */

/*Table structure for table `stock_stats` */

DROP TABLE IF EXISTS `stock_stats`;

CREATE TABLE `stock_stats` (
  `stock_stats_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `year` int(11) DEFAULT NULL,
  `month` int(11) DEFAULT NULL,
  `opening_stock` double DEFAULT NULL,
  `total_purchase` double DEFAULT NULL,
  `total_sales` double DEFAULT NULL,
  `closing_stock` double DEFAULT NULL,
  `status` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`stock_stats_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `stock_stats` */

